import "./App.css";

const Header = () => {
  return <div className="header"></div>;
};
const Navi = () => {
  return <div className="navi"></div>;
};
const Body = () => {
  return <div className="body">
    <div className="section"></div>;
    <div className="side"></div>
  </div>;
};
const Footer = () => {
  return <div className="footer"></div>;
};


function App() {
  return (
    <div className="container">
      <Header />
      <Navi />
      <Body>
      </Body>
      <Footer />
    </div>
  );
}

export default App;
